import React from "react";
import BlobItem from "../BlobItem/BlobItem";

const Blob = ({
  technologyStack = [],
  color = "#f2f2f2",
  title = "[Title Here]",
}) => {
  const renderBlobItems = technologyStack.map((item) => {
    return <BlobItem />;
  });

  return (
    <div style={this.color}>
      <h2>{this.title}</h2>
      {this.renderBlobItems()}
    </div>
  );
};

export default Blob;
